description:
Long ago, in a time forgotten, a force destroyed the balance of the seasons. In a land where summers can last several years and the winter a lifetime, claims and supernatural forces are at the gates of the Kingdom of the Seven Kingdoms. The Night's Watch fellowship seeks to protect the kingdom of every creature that can come from beyond the Wall, but no longer has the resources necessary to ensure the safety of all. After a summer of ten years a harsh winter promises to come up with a darker future. Meanwhile, conspiracies and rivalries run in the political game for the dispute of the Iron Throne, the symbol of absolute power.

